// Function to query the subgraph for requests and operators
async function fetchDataFromSubgraph() {
  const query = gql`
    query Requests($operator: String) {
      requests(where: { operator: $operator }, first: 1000, orderBy: id, orderDirection: desc) {
        operator {
          id
        }
        request {
          requestId
          requester
          minBlockConfirmations
          blockNumber
          blockTimestamp
          transactionHash
          nonce
          callbackGasLimit
        }
        fulfillment {
          randomness
          blockNumber
          blockTimestamp
          transactionHash
          nonce
        }
      }
      operators(first: 1000) {
        id
      }
    }
  `;


  try {
    const variables = { operator: OPERATOR_ADDRESS };
    const data = await request(SUBGRAPH_URL, query, variables);
    return data.requests;
  } catch (error) {
    console.error("Error fetching data from subgraph:", error);
    return [];
  }
}

// Function to generate proof
async function generateProof(requestData) {
  try {
    // Initialize Noir with the compiled circuit
    const noir = new Noir(circuit);

    // Initialize the Barretenberg backend with the circuit's bytecode
    const backend = new UltraPlonkBackend(circuit.bytecode, {
      threads: navigator.hardwareConcurrency,
    });
    // Extract required fields from the request data
    

    // Execute the circuit to get the witness
    const { witness } = await noir.execute({
      message_hash:requestData.message_hash,
      private_key:requestData.private_key,
      public_key:requestData.public_key
    });

    // Generate proof using the witness
    const proof = await backend.generateProof(witness);
    console.log("Proof generated successfully:", proof);

    // Convert proof to hex string (if needed)
    const proofData = uint8ArrayToHexString(proof.proof);
    console.log("Proof Data (Hex):", proofData);
    console.log("Public Inputs:", proof.publicInputs);

    // Verify the proof (optional)
    const isValid = await backend.verifyProof(proof);
    console.log("Proof verification result:", isValid);

    return { proof: proofData, publicInputs: proof.publicInputs };
  } catch (error) {
    console.error("Error generating proof:", error);
    throw error;
  }
}



