async function getMessageHash(request) {
  console.log('requestdata',request);
  try {
    if (!request?.request?.blockNumber) {
      throw new Error("Invalid request data");
    }

    // Convert block number to BigInt
    const blockNumber = BigInt(request.request.blockNumber);

    // Fetch block hash
    const blockHash = await blockHashHistorianContract.getBlockHash(blockNumber);
    // console.log("Block Hash:", blockHash);

    // Compute message hash using the retrieved block hash
    const messageHash = await zkvrfContract.hashSeedToField(
      request.request.requester,
      blockHash, // Using the actual fetched block hash
      BigInt(request.request.nonce) // Convert nonce to BigInt
    );

    console.log("Message Hash:", messageHash);
    return messageHash;
  } catch (error) {
    console.error("Error fetching message hash:", error);
    return null;
  }
}

// Polling mechanism to listen for new data
async function pollSubgraph() {
  console.log("Polling subgraph for new data...");
  const requests = await fetchDataFromSubgraph();

  if (requests.length > 0) {
    for (const requestData of requests) {
      // console.log("New request detected:", requestData);

      if (requestData.request.requestId === '0'&& !executedNonces.includes(requestData.request.requestId)) {
         const messageHash = await getMessageHash(requestData);
         console.log("Final Message Hash:", messageHash);
         console.log('data private',messageHash,ZKV_PRIVATE,OPERATOR_ADDRESS);
         const { proof, publicInputs } = await generateProof({message_hash:messageHash,private_key:ZKV_PRIVATE,public_key:OPERATOR_ADDRESS});
         const data = { "vkey": VK, "proof":proof,"pubsignal":publicInputs };
         try{
         const response = await axios.post(`http://doranode:${loginServicePort}/verify`, data);
         console.log("Response:", response.data);
         executedNonces.push(requestData.request.requestId);
        //  return response.data;
         }catch (error) {
          if (error.code === "ECONNREFUSED") {
              console.error(`ðŸš¨ Connection failed: Cannot reach ${error.config?.url || "server"}.`);
          } else {
              console.error("Unexpected error:", error.message);
          }
      }

      } else {
        console.log("Fulfillment exists:", requestData.fulfillment);
      }
       
      // Generate proof
      // const { proof, publicInputs } = await generateProof({message_hash:messageHash,private_key:ZKV_PRIVATE,public_key:OPERATOR_ADDRESS});

      // Send proof to the API
      // await sendProofToAPI(proof, publicInputs);
    }
  }

  // Continue polling
  setTimeout(pollSubgraph, POLL_INTERVAL);
}

